import React, { Component } from 'react';
import cover from "../img/depositphotos_10728208-stock-photo-assorted-vegetables.jpg";

class Home extends Component {
    state = {  }
    render() { 
        return ( 
            <React.Fragment>
                <h1>Hello</h1>
                <img src={cover} alt="" size="100% 100%"/>
            </React.Fragment>
     );
    }
}
 
export default Home;
